import React from "react";
import { Box, HStack } from "@chakra-ui/react";

// const links = [{name:  }, { About }, {}, {}, {}, {}];

function Nav() {
  return (
    <header>
      <h3>Logo</h3>
      <nav>
        <a href="#home">Home</a>
        <a href="#about">About</a>
        <a href="#menu">Menu</a>
        <a href="#reservations">Reservations</a>
        <a href="#orderonline">Order Online</a>
        <a href="#login">Login</a>
      </nav>
    </header>
  );
}

export default Nav;
